import "./FormStyles.css";


import React from 'react'

const Form = () => {
  return (
    <div className="form">
      <form>
        <label>Your Name</label>
        <input type="text"></input>

        <label>Email</label>
        <input type="email"></input>

        <label>Subje</label>
        <input type="text"></input>
      </form>
    </div>
  )
}

export default Form;
